  public enum BMT5_ENUM_SYMBOL_CALC_MODE {
    /// <summary>
    /// Forex mode - calculation of profit and margin for Forex // Margin:  Lots * Contract_Size / Leverage * Margin_Rate  // Profit:  (close_price - open_price) * Contract_Size * Lots
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_FOREX")] Bmt5SymbolCalcModeForex = 0,
    /// <summary>
    /// Forex No Leverage mode  calculation of profit and margin for Forex symbols without taking into account the leverage // Margin:  Lots * Contract_Size * Margin_Rate // Profit:  (close_price - open_price) * Contract_Size * Lots
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_FOREX_NO_LEVERAGE")] Bmt5SymbolCalcModeForexNoLeverage = 1,
    /// <summary>
    /// Futures mode - calculation of margin and profit for futures   // Margin: Lots * InitialMargin * Margin_Rate  // Profit:  (close_price - open_price) * TickPrice / TickSize * Lots
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_FUTURES")] Bmt5SymbolCalcModeFutures = 2,
    /// <summary>
    /// CFD mode - calculation of margin and profit for CFD    // Margin: Lots * ContractSize * MarketPrice * Margin_Rate  // Profit:  (close_price - open_price) * Contract_Size * Lots
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_CFD")] Bmt5SymbolCalcModeCfd = 3,
    /// <summary>
    /// CFD index mode - calculation of margin and profit for CFD by indexes    // Margin: (Lots * ContractSize * MarketPrice) * TickPrice / TickSize * Margin_Rate  // Profit:  (close_price - open_price) * Contract_Size * Lots
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_CFDINDEX")] Bmt5SymbolCalcModeCfdindex = 4,
    /// <summary>
    /// CFD Leverage mode - calculation of margin and profit for CFD at leverage trading   // Margin: (Lots * ContractSize * MarketPrice) / Leverage * Margin_Rate  // Profit:  (close_price - open_price) * Contract_Size * Lots
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_CFDLEVERAGE")] Bmt5SymbolCalcModeCfdleverage = 5,
    /// <summary>
    /// Exchange mode  calculation of margin and profit for trading securities on a stock exchange  // Margin: Lots * ContractSize * LastPrice * Margin_Rate  // Profit:  (close_price - open_price) * Contract_Size * Lots
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_EXCH_STOCKS")] Bmt5SymbolCalcModeExchStocks = 6,
    /// <summary>
    /// Futures mode  calculation of margin and profit for trading futures contracts on a stock exchange // Margin: Lots * InitialMargin * Margin_Rate or Lots * MaintenanceMargin * Margin_Rate // Profit:  (close_price - open_price) * Lots * TickPrice / TickSize
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_EXCH_FUTURES")] Bmt5SymbolCalcModeExchFutures = 7,
    /// <summary>
    /// FORTS Futures mode  calculation of margin and profit for trading futures contracts on FORTS. The margin may be reduced by the amount of MarginDiscount deviation according to the following rules:  // 1. If the price of a long position (buy order) is less than the estimated price, MarginDiscount = Lots * ((PriceSettle - PriceOrder) * TickPrice / TickSize) // 2. If the price of a short position (sell order) exceeds the estimated price, MarginDiscount = Lots * ((PriceOrder - PriceSettle) * TickPrice / TickSize) // where: // PriceSettle  estimated (clearing) price of the previous session; // PriceOrder  average weighted position price or open price set in the order (request); // TickPrice  tick price (cost of the price change by one point) // TickSize  tick size (minimum price change step) // Margin: Lots * InitialMargin * Margin_Rate or Lots * MaintenanceMargin * Margin_Rate // Profit:  (close_price - open_price) * Lots * TickPrice / TickSize
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_EXCH_FUTURES_FORTS")] Bmt5SymbolCalcModeExchFuturesForts = 8,
    /// <summary>
    /// Exchange Bonds mode  calculation of margin and profit for trading bonds on a stock exchange  // Margin: Lots * ContractSize * FaceValue * open_price / 100  // Profit:  Lots * close_price * FaceValue * Contract_Size + AccruedInterest * Lots * ContractSize
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_EXCH_BONDS")] Bmt5SymbolCalcModeExchBonds = 9,
    /// <summary>
    /// Exchange MOEX Stocks mode  calculation of margin and profit for trading securities on MOEX  // Margin: Lots * ContractSize * LastPrice * Margin_Rate  // Profit:  (close_price - open_price) * Contract_Size * Lots
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_EXCH_STOCKS_MOEX")] Bmt5SymbolCalcModeExchStocksMoex = 10,
    /// <summary>
    /// Exchange MOEX Bonds mode  calculation of margin and profit for trading bonds on MOEX  // Margin: Lots * ContractSize * FaceValue * open_price / 100 // Profit:  Lots * close_price * FaceValue * Contract_Size + AccruedInterest * Lots * ContractSize
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_EXCH_BONDS_MOEX")] Bmt5SymbolCalcModeExchBondsMoex = 11,
    /// <summary>
    /// Collateral mode - a symbol is used as a non-tradable asset on a trading account. The market value of an open position is calculated based on the volume, current market price, contract size and liquidity ratio. The value is included into Assets, which are added to Equity. Open positions of such symbols increase the Free Margin amount and are used as additional margin (collateral) for open positions of tradable instruments. // Margin: no  // Profit: no  // Market Value: Lots * ContractSize * MarketPrice * LiquidityRate
    /// </summary>
    [pbr::OriginalName("BMT5_SYMBOL_CALC_MODE_SERV_COLLATERAL")] Bmt5SymbolCalcModeServCollateral = 12,
  }

